column8:
Support to livelihood enhancement through provision of: 27,000 hand hoes;
20,000 iron sheets; 1000 ox ploughs; support to 450 micro projects;
procurement of 1 tractor and 1 trailer; construction of 1 valley tank; completion
of 4 classroom block at Kaler primary school; drilling of borehole in Ngora and
construction of teachers house in Ngora.
